import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <Container fluid>
                <Row sm={12} md={12} lg={12} className="justify-content-md-center row-1">
                    <Col sm md={2} lg={2} className="justify-content-md-center colm fila col-style">
                        <Container>
                            <Row>
                                <Col className='fila'>
                                    <img src='https://coreui.io/react/demo/static/media/logo.406a451a.svg' />
                                </Col>
                                <Col className='fila'>
                                    <i class="fa fa-bars"></i>
                                </Col>
                            </Row>
                        </Container>
                    </Col>
                    <Col sm md={10} lg={10} className="justify-content-md-center colm">
                        hola
                    </Col>
                </Row>
                <Row sm={12} md={12} lg={12} className="justify-content-md-center row-2">
                    <Col sm md={2} lg={2} className="justify-content-md-center colm">
                        hola
                    </Col>
                    <Col sm md={10} lg={10} className="justify-content-md-center colm">
                        hola
                    </Col>
                </Row>
            </Container>
            <style global jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                    margin:0; padding:0;
                }

                .row-1{
                    width: 100%;
                    height: 5%;
                    margin: 0;
                    padding: 0;
                }
                .row-2{
                    width: 100%;
                    height: 95%;
                    margin: 0;
                    padding: 0;
                }
                .colm{
                    width: 100%;
                }
                .fila{
                    border: solid 1px;
                }
                img{
                    width: 80%;
                }
            `}</style>
            <style>{`
                .col-style{
                    justify-content: center;
                        align-items: center;
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
